package parser

import (
	"testing"
)

func BenchmarkSysbenchSelect(b *testing.B) {
	parser := New()
	sql := "SELECT pad FROM sbtest1 WHERE id=1;"
	b.ResetTimer()
	for i := 0; i < b.N; i++ {
		_, err := parser.Parse(sql, "", "")
		if err != nil {
			b.Fatal(err)
		}
	}
	b.ReportAllocs()
}

